// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "./DFA.sol";
import "./Exchanger.sol";

contract Factory {
//  struct ExchangerRequestInfo {
//    address user;
//    uint amountToGet;
//    uint amountToGive;
//  }
//
//  struct ExchangerRequestFullInfo {
//    address user;
//    address dfaToGet;
//    uint amountToGet;
//    address dfaToGive;
//    uint amountToGive;
//  }
  struct DfaInfo {
    address dfaAddress;
    string name;
    string symbol;
    uint totalSupply;
  }

  address[] dfaList;
  mapping(address => address) dfaToExchanger;

  modifier isAddressValid(address addressToCheck) {
    require(addressToCheck != address(0), "Invalid token address");
    _;
  }

  function createDfa(
    uint initialSupply,
    string memory name,
    string memory symbol
  ) external returns (address) {
    address dfaAddress = address(
      new DFA(
        initialSupply,
        name,
        symbol,
        msg.sender
      )
    );
    Exchanger exchanger = new Exchanger(dfaAddress);
    dfaToExchanger[address(dfaAddress)] = address(exchanger);
    dfaList.push(dfaAddress);
    return dfaAddress;
  }

  function getExchanger(address dfaAddress) public view returns (address) {
    return dfaToExchanger[dfaAddress];
  }

  function getAllDfa() public view returns (DfaInfo[] memory) {
    DfaInfo[] memory info = new DfaInfo[](dfaList.length);
    for (uint i = 0; i < dfaList.length; i++) {
      address dfaAddress = dfaList[i];
      DFA dfa = DFA(dfaAddress);
      info[i] = DfaInfo(
        dfaAddress,
        dfa.name(),
        dfa.symbol(),
        dfa.totalSupply()
      );
    }
    return info;
  }

